import React from 'react'

export default function Card(props) {
  let options = props.options;
  let prices = Object.keys(options);

  return (
    <div>
      <div className="card mt-3" style={{ "width": "18rem", "height": "470px" }}>
        <img src={props.imgSrc} className="card-img-top" style={{ "height": "220px" }} alt="..." />
        <div className="card-body">
          <h5 className="card-title">{props.foodName}</h5>
          <p className="card-text">{props.description}</p>
          <div className='container w-100'>
            <select className='m-2 h-100  bg-success rounded'>
              {Array.from(Array(10), (e, i) => {
                return (
                  <option key={i + 1} value={i + 1}>{i + 1}</option>
                )
              })}
            </select>

            <select className='m-2 h-100  bg-success rounded'>
              {
                prices.map((item) => { return (<option key={item} value={item}>{item}</option>) })
              }
            </select>

            <div className='d-inline h-100 fs-5'>
              Total
            </div>
            <hr></hr>
            <button></button>
          </div>
        </div>
      </div>
    </div>
  )
}
